import dbparseimport inspectfrom dbparse import ConcatFileTypedef test_concatfiletype():    cfts = []    cft = ConcatFileType(inputName="ShuffleAlbum", inputType="Shuffle",                         outputName="ArtistAlbum", outputFormat="DataFrame")    cfts.append(cft)        for cft in cfts:        assert isinstance(cft.getOutput(), dict), f"output [{cft.getOutput()}] is not a dict"        assert hasattr(cft, "concatClassName"), f"[{cft}] does not have a concatClassName attr"        concatClassName = getattr(cft, "concatClassName")        assert isinstance(concatClassName, str), f"pft [{cft}] concatClassName is not a str"        concatClass = getattr(dbparse, concatClassName)        assert inspect.isclass(concatClass), f'concatClass [{cft.mergeClassName}] is not a class'        assert hasattr(concatClass, "concat"), f"concat Class [{concatClassName}] does not have a concat function"if __name__ == "__main__":    test_concatfiletype()